import React, { useEffect, useState } from 'react';
import axios from 'axios';
import { useLocation } from 'react-router-dom';
import Table from 'react-bootstrap/Table';
import "./artistes.css"


function Artistes() {

  const [Artistes, setArtistes] = useState([]);
  const {search} =useLocation();
  useEffect(() => {
  const Artistedata = async () => {
    const { data } = await axios.get('/artist'+search);
    setArtistes(data);
  }
  Artistedata()
},[search])
  return (
 <div className='Artistes'>

<table id="customers">
  <tr>
    <th>date Naiss</th>
    <th>date Deces</th>
    <th>nationalite</th>
    <th>biographie</th>
    <th>biographie</th>
    <th>biographie</th>

  </tr>
  {Artistes.map((art) => (
  <tr>
    <td>{art.dateNaiss}</td>
    <td>{art.dateDeces}</td>
    <td>{art.nationalite}</td>
    <td>{art.biographie}</td>
  </tr>
      ))}

  
  
</table>

        <h1>helooooooooooooooooooo</h1>
      {Artistes.map((art) => (
        <div key={art.dateNaiss}>
           <h1>{art.dateNaiss}</h1> 
        </div>
      ))}
    </div>
  );
}

export default Artistes;
